import React from "react";
import ReactDom from "react-dom";
import Card from "./Card";
import Mdata from "Mdata";
import "./index.css";

ReactDom.render(
  <>
  <h1 className="heading">Hotstar Specials & Latest Movies</h1>
    <Card 
      imgsrc={Mdata[0].imgsrc}
      title={Mdata[0].title}
      fname={Mdata[0].fname}
      flink={Mdata[0].flink}
    />
    <Card
      imgsrc={Mdata[1].imgsrc}
      title={Mdata[1].title}
      fname={Mdata[1].fname}
      flink={Mdata[1].flink}
    />
    <Card
      imgsrc={Mdata[2].imgsrc}
      title={Mdata[2].title}
      fname={Mdata[2].fname}
      flink={Mdata[2].flink}
    />
  </>, 
 document.getElementById("root")

);
